class Solution {
    func canSplitArray(_ nums: [Int], _ m: Int) -> Bool {
        let n = nums.count
        var prefixSum = [Int](repeating: 0, count: n+1)
        for i in 0..<n {
            prefixSum[i+1] = prefixSum[i] + nums[i]
        }

        var dp = [[Bool]](repeating: [Bool](repeating: false, count: n+1), count: n+1)
        dp[0][0] = true // Base case: zero elements can always form 0 arrays

        for end in 1...n {
            for start in stride(from: end-1, through: 0, by: -1) {
                for splitPoint in start..<end {
                    let leftSum = prefixSum[splitPoint+1] - prefixSum[start]
                    let rightSum = prefixSum[end] - prefixSum[splitPoint+1]
                    if (leftSum >= m || splitPoint+1-start == 1) && (rightSum >= m || end-splitPoint-1 == 1) && dp[start][splitPoint] && dp[splitPoint+1][end] {
                        dp[start][end] = true
                        break
                    }
                }
            }
        }

        return dp[0][n]
    }
}
